CREATE TABLE IF NOT EXISTS `track_habits` (
`id` INT NULL,
`user_id` INT NULL,
`name` VARCHAR(MAX) NULL,
`incident_count` INT NULL,
`appalled_rating` INT NULL,
`appalled_result` VARCHAR(MAX) NULL,
`icon` VARCHAR(MAX) NULL,
`description` VARCHAR(MAX) NULL,
`img` VARCHAR(MAX) NULL,
`date_create` VARCHAR(MAX) NULL
);

